import logo from './logo.svg';
import './App.css';
import Navbar from './Navbar'
import Searchbox from './Searchbox';

function App() {
  const myStyle ={
    backgroundColor:"black"
  };

  return (

      <div className="App"> style={myStyle}
        <Navbar/>
        <Searchbox/>
      </div>

  );
}

export default App;

